public class AnomalyDetectorFactory(string resourceName = null, Action<Humidifier.CloudWatch.AnomalyDetector> factoryAction = null) : ResourceFactory<Humidifier.CloudWatch.AnomalyDetector>(resourceName)
{

    internal List<InnerAnomalyDetectorDimensionFactory> DimensionsFactories { get; set; } = [];

    internal InnerAnomalyDetectorMetricCharacteristicsFactory MetricCharacteristicsFactory { get; set; }

    internal InnerAnomalyDetectorConfigurationFactory ConfigurationFactory { get; set; }

    internal InnerAnomalyDetectorMetricMathAnomalyDetectorFactory MetricMathAnomalyDetectorFactory { get; set; }

    internal InnerAnomalyDetectorSingleMetricAnomalyDetectorFactory SingleMetricAnomalyDetectorFactory { get; set; }

    protected override Humidifier.CloudWatch.AnomalyDetector Create()
    {
        var anomalyDetectorResult = CreateAnomalyDetector();
        factoryAction?.Invoke(anomalyDetectorResult);

        return anomalyDetectorResult;
    }

    private Humidifier.CloudWatch.AnomalyDetector CreateAnomalyDetector()
    {
        var anomalyDetectorResult = new Humidifier.CloudWatch.AnomalyDetector
        {
            GivenName = InputResourceName,
        };

        return anomalyDetectorResult;
    }
    public override void CreateChildren(Humidifier.CloudWatch.AnomalyDetector result)
    {
        base.CreateChildren(result);

        result.Dimensions = DimensionsFactories.Any() ? DimensionsFactories.Select(x => x.Build()).ToList() : null;
        result.MetricCharacteristics ??= MetricCharacteristicsFactory?.Build();
        result.Configuration ??= ConfigurationFactory?.Build();
        result.MetricMathAnomalyDetector ??= MetricMathAnomalyDetectorFactory?.Build();
        result.SingleMetricAnomalyDetector ??= SingleMetricAnomalyDetectorFactory?.Build();
    }

} // End Of Class

